import collections
from queue import PriorityQueue
from config import *
from scipy.spatial import distance


def bfs(grid, start, end):
    skip = True
    queue = collections.deque([[start]])
    seen = set([start])
    while queue:
        path = queue.popleft()
        x, y = path[-1]

        if (x, y) == end:
            return path

        for x2, y2 in ((x+1, y), (x-1, y), (x, y+1), (x, y-1)):
            if 0 <= x2 <= (len(grid) - 1) \
                    and 0 <= y2 <= (len(grid[len(grid) - 1]) - 1) \
                    and (x2, y2) not in seen and grid[x2][y2] not in [3, 5]:

                if grid[x2][y2] != 2 or skip:
                    queue.append(path + [(x2, y2)])

                    seen.add((x2, y2))

                if grid[x2][y2] != 2:
                    skip = False


def ucs(grid, start, end):
    skip = True
    visited = set()
    queue = PriorityQueue()
    queue.put((0, [start]))

    while queue:
        cost, path = queue.get()
        x, y = path[-1]

        if (x, y) not in visited:
            visited.add((x, y))

            if (x, y) == end:

                return path

            for x2, y2 in ((x + 1, y), (x - 1, y), (x, y + 1), (x, y - 1)):
                if 0 <= x2 < int(Config.WORLD_DIM[0] / zoom) + 1 \
                        and 0 <= y2 < int(
                    Config.SPACESHIP_STARTING_POSITION[1] / zoom) + 1 \
                        and (x2, y2) not in visited and grid[y2][x2] not in [3, 4, 5]:

                    if grid[y2][x2] != 2 or skip:
                        total_cost = cost + 1
                        queue.put((total_cost, path + [(x2, y2)]))

                    if grid[y2][x2] != 2:
                        skip = False


def dfs(grid, start):
    skip = True
    visited = set()
    stack = collections.deque([[start]])

    while stack:
        path = stack.pop()
        x, y = path[-1]

        if (x, y) in visited:
            continue

        visited.add((x, y))

        if grid[y][x] == 9:
            return path

        for x2, y2 in ((x+1, y), (x-1, y), (x, y+1), (x, y-1)):
            if 0 <= x2 < int(Config.WORLD_DIM[0] / zoom) + 1 \
                    and 0 <= y2 < int(Config.SPACESHIP_STARTING_POSITION[1] / zoom) + 1\
                    and (x2, y2) not in visited \
                    and grid[y2][x2] not in [3, 4, 5]:

                if grid[y2][x2] != 2 or skip:
                    stack.append(path + [(x2, y2)])

                if grid[y2][x2] != 2:
                    skip = False


class Node:
    """A node class for A* Pathfinding"""

    def __init__(self, parent=None, position=None):
        self.parent = parent
        self.position = position

        self.g = 0
        self.h = 0
        self.f = 0

    def __eq__(self, other):
        return self.position == other.position


def a_star(grid, start, end):
    skip = True
    st_node = Node(position=start)
    end_node = Node(position=end)

    open_list = [st_node]
    closed_list = []

    while open_list:

        curr_ix, curr_node = min(enumerate(open_list), key=lambda x: x[1].f)
        open_list.pop(curr_ix)
        closed_list.append(curr_node)
        if curr_node == end_node:

            path = [curr_node.position]
            dist = curr_node.f
            tmp_node = curr_node
            while tmp_node.parent is not None:
                path.insert(0, tmp_node.parent.position)
                tmp_node = tmp_node.parent

            return path, dist

        children = []

        x, y = curr_node.position


        for x2, y2 in ((x + 1, y), (x - 1, y), (x, y + 1), (x, y - 1)):
            if x2 > (len(grid) - 1) or x2 <= 0 or \
                    y2 > (len(grid[len(grid) - 1]) - 1) or \
                    y2 <= 0:
                continue

            # try:
            if grid[y2][x2] not in [1, 2, 9, 3, 4, 5]:

                skip = False

                continue

            children.append(Node(curr_node, (x2, y2)))


        for child in children:
            for closed_child in closed_list:
                if child == closed_child:
                    continue

            child.g = curr_node.g + 1
            child.h = distance.euclidean(child.position, end_node.position) ** 2
            child.f = child.g + child.h

            # Child is already in the open list
            for open_node in open_list:
                if child == open_node and child.g > open_node.g:
                    continue

            # Add the child to the open list
            open_list.append(child)

    return None, None

